const signOut = async (navigation) => {
  try {
    await AsyncStorage.setItem('isLoggedIn', 'false');

    navigation.dispatch(
      CommonActions.reset({
        index: 0,
        routes: [{ name: 'Landing' }],
      }),
    );
    RNRestart.Restart();
  } catch (error) {
    console.log('Error signing out: ', error);
  }
};
